// to GeoJSON format
let converterGeoJSON = (arrayOfChurch) => {
  let newJSONArray = [];
  arrayOfChurch.forEach((element) => {
    let coordinates = [];
    let name = element.name;
    let objFeature = {
      type: "Feature",
      geometry: { type: "Point", coordinates: coordinates },
      properties: { prop0: name },
      // crs: {
      //   type: "name",
      //   properties: {
      //     name: "EPSG:4326",
      //     // name: "EPSG:900913",
      //     // name: "urn:ogc:def:crs:OGC:1.3:CRS84",
      //   },
      // },
    };
    coordinates.push(element.lon);
    coordinates.push(element.lat);

    newJSONArray.push(objFeature);
  });

  let JSONFile = { type: "FeatureCollection", features: newJSONArray };
  console.log(JSONFile);
  return JSONFile;
};

converterGeoJSON(arrayOfChurch);
